import React from 'react';

function ProfilePage({ user }) {
    if (!user) {
        return <p>Loading user profile...</p>;
    }

    return (
        <div>
            <h1>Welcome, {user.name || user.username || "User"}!</h1>
            <p>Email: {user.email || user.emails?.[0]}</p>
        </div>
    );
}

export default ProfilePage;
